import { Route, Routes, Link } from 'react-router-dom';
import { routes } from './routes';
import { Fragment } from 'react';
function App() {
    return (
        <div className="app">
            <div className="header">
                <Link to="/">
                    <h1>Dashboard</h1>
                </Link>
                <Link to="/printerPage">
                    <h1>Printer Page</h1>
                </Link>
                <Link to="/studentPage">
                    <h1>StudentPage</h1>
                </Link>
            </div>
            <h3>Content</h3>
            
        </div>
    );
}

export default App;
